svg.script:


document.addEventListener('DOMContentLoaded', function(event) {
  const icons = document.children[0].getElementsByTagName("svg");

  for (let i = 0; i < icons.length; i++) {
    icons[i].setAttribute("x", (i%10)+"em");
    icons[i].setAttribute("y", Math.floor(i/10)+"em");
  }
  document.children[0].classList.add("preview");
});
